,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'-- =============================================================================',
'--',
'--  Created by Richard Baldogi',
'--',
'--  This plug-in helps to append excel tables into an Interactive Grid.',
'--',
'--  License: MIT',
'--',
'--  GitHub: https://github.com/baldogiRichard/apex-copy-excel-to-ig',
'--',
'-- =============================================================================',
'',
'--render function',
'function render ',
'  ( p_dynamic_action in apex_plugin.t_dynamic_action',
'  , p_plugin         in apex_plugin.t_plugin ',
'  )',
'return apex_plugin.t_dynamic_action_render_result',
'as',
'    l_result          apex_plugin.t_dynamic_action_render_result;',
'    l_ajax_id         varchar2(4000) := apex_plugin.get_ajax_identifier;',
'',
'    --attributes',
'    l_mode                     p_dynamic_action.attribute_01%type := p_dynamic_action.attribute_01;',
'    l_filename                 p_dynamic_action.attribute_02%type := nvl(p_dynamic_action.attribute_02,''table'');',
'    l_fbrowser_item            p_dynamic_action.attribute_03%type := p_dynamic_action.attribute_03;',
'    l_ig_name                  p_dynamic_action.attribute_05%type := p_dynamic_action.attribute_05;',
'    l_selectlist_item          p_dynamic_action.attribute_06%type := p_dynamic_action.attribute_06;',
'    l_extension_type           p_dynamic_action.attribute_07%type := p_dynamic_action.attribute_07;',
'',
'begin',
'    ',
'    --debug',
'    if apex_application.g_debug',
'    then',
'        apex_plugin_util.debug_dynamic_action',
'          ( p_plugin         => p_plugin',
'          , p_dynamic_action => p_dynamic_action',
'          );',
'    end if;',
'',
'    --Pass attribute values to JSON',
'    apex_json.initialize_clob_output;',
'',
'        apex_json.open_object;',
'',
'            apex_json.write(''mode''                  , l_mode                );',
'            apex_json.write(''fileName''              , l_filename            );',
'            apex_json.write(''fileBrowserItemName''   , l_fbrowser_item       );',
'            apex_json.write(''igName''                , l_ig_name             );',
'            apex_json.write(''selectListItem''        , l_selectlist_item     );',
'            apex_json.write(''extensionType''         , l_extension_type      );',
'',
'        apex_json.close_object;',
'',
'        --if pasting from the clipboard then add event to onload code',
'        if l_mode = ''PASTE'' then ',
'            apex_javascript.add_onload_code(p_code => ''CETOIG.pasteFromClipboardPrepare();'');',
'        end if;',
'',
'        l_result.javascript_function := ''function(){CETOIG.main('' || apex_json.get_clob_output|| '');}'';',
'    ',
'    apex_json.free_output;',
'',
'    apex_json.free_output;',
'    ',
'    return l_result;',
'    ',
'end render;'))
,p_api_version=>2
,p_render_function=>'render'
,p_standard_attributes=>'REGION'
,p_substitute_attributes=>true
